import React from "react";
import "./searchBar.css";

const SearchBar = ({ border }) => {
  const setBorder = border => {
    if (border) {
      return "searchForBorder";
    }
    return "searchFor";
  };

  const setBorderInput = border => {
    if (border) {
      return "searchInputBorder";
    }
    return "searchInput";
  };

  return (
    <div className="searchBar">
      <p className={setBorder()} style={{ borderRadius: `10px 0px 0px 10px` }}>
        Find
      </p>
      <input
        className={setBorderInput()}
        type="text"
        placeholder="Sushi... burgers... pasta..."
      />
      <p
        id="searchIn"
        className={setBorder()}
        style={{ borderRadius: `0px 0px 0px 0px` }}
      >
        in
      </p>
      <input
        className={setBorderInput()}
        type="text"
        placeholder="New York City"
      />
      <button type="search" id="searchBtn">
        Search{" "}
      </button>
      {/* add dropdown "results for..." click to search instead of actual search
      button */}
    </div>
  );
};

export default SearchBar;
